// ... các import khác ...
import { ThemeProvider, CssBaseline, Container, Typography, IconButton, Box, Paper } from '@mui/material'; // Không cần createTheme ở đây nữa
// ...
import { getAppTheme } from './theme'; // Import theme đã tạo

// ...
function App() {
  // ... state themeMode ...
  const appTheme = useMemo(() => getAppTheme(themeMode), [themeMode]); // getAppTheme giờ trả về theme đã được tạo

  return (
    <LocalizationProvider dateAdapter={AdapterDateFnsV3}> {/* Đảm bảo dùng AdapterDateFnsV3 */}
      <ThemeProvider theme={appTheme}>
        <CssBaseline />
        {/* ... phần còn lại của App ... */}
      </ThemeProvider>
    </LocalizationProvider>
  );
}
